import React from "react";
function Card(props) {
    return (
        <>
            <div className='card_container'>
                <div className="all">
                <div className='img'>
                    <img src={props.imgsrc} alt='image'></img>
                </div>
                <h4>{props.ctitle}</h4>
                <h3>{props.stitle}</h3>
                <button>Watch Now</button>
                </div>
            </div>
        </>
    )
}

export default Card;
